$(function(){var n=$(".loginInfo");n.find("button").on("click",function(){console.log("click"),$.ajax({type:"post",url:"/api/user/login",data:{username:n.find('[name="username"]').val(),password:n.find('[name="password"]').val()},dataType:"json",success:function(o){n.find(".info").html(o.message),o.code||window.location.assign("/admin/usersList")}})}),$("#logout").on("click",function(){$.ajax({url:"/api/user/logout",success:function(n){n.code||window.location.reload()}})})});